Low Power Listening interface

@author Jonathan Hui
@author David Moss

Configure this outgoing message so it can be transmitted to a neighbor mote
with the specified wakeup interval.
@param 'message_t* ONE msg' Pointer to the message that will be sent
@param intervalMs The receiving node's wakeup interval, in [ms]

Set this this node's radio wakeup interval, in milliseconds. After each interval, the node will wakeup and check for radio activity.
Note: The wakeup interval can be set to 0 to indicate that the radio should stay on all the time but in order to get a startDone this should only be done when the duty-cycling is off (after a stopDone).
@param intervalMs the length of this node's Rx check interval, in [ms]

Busy wait for (at least) dt time units. Use sparingly, when the
cost of using an Alarm or Timer would be too high.
@param dt Time to busy wait for.


The radio stack notifies the entire system that it is about to send
a packet.  Other modules in the system can call back within this event
to modify the packet's metadata. For example, we can setup a module
in the system to make every CTP data packet send with low power listening
enabled:

  event void SendNotifier.aboutToSend[AM_COLLECTION_DATA](uint8_t dest,
      message_t *msg) {
    call LowPowerListening.setRxSleepInterval(msg, 512);
  }

@author David Moss

The system is about to send this message. Fill in any last modifications
and the message will be sent.

@param dest The destination address of the messsage
@param 'message_t* ONE msg' The message about to be transmitted

Set the active message address of this node
@param group The node's group ID
@param addr The node's active message address

Return the delay or period for the previously started timer. The next
fired event will occur at gett0() + getdt().
@return Timer's interval.

Check if timer is running. Periodic timers run until stopped or
replaced, one-shot timers run until their deadline expires.

@return TRUE if the timer is still running.


Return current time. Time starts counting at boot - some time sources
may stop counting while the processor is in low-power mode.

@return Current time.

Return the time the currently running alarm will fire or the time that
the previously running alarm was set to fire.
@return Alarm time.


Return counter value. Counters start at boot - some time sources may
stop counting while the processor is in low-power mode.
@return Current counter value.


Return TRUE if an overflow event will occur after the outermost atomic
block is exits.  FALSE otherwise.
@return Counter pending overflow status.
